 "Correct Location (y)": "Prawid\u0142owe Po\u0142o\u017cenie (y)", 
 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p><p>More than one possible answer can be defined enclosing them with pipes (|). I.e.: |dog|cat|bird|<\/p>": "<p>Wprowad\u017a tekst dla aktywno\u015bci wype\u0142nianie luk w polu Tekst z lukami, \nwklejaj\u0105c tekst z innego \u017ar\u00f3d\u0142a lub wpisuj\u0105c tekst bezpo\u015brednio \nw pole.<\/p><p> Aby wybra\u0107 s\u0142owa do ukrycia, kliknij dwukrotnie s\u0142owo, aby je zaznaczy\u0107 \ni kliknij ni\u017cej przycisk Ukryj\/Poka\u017c s\u0142owo.<\/p><p>Mo\u017cna zdefiniowa\u0107 wi\u0119cej ni\u017c jedn\u0105 mo\u017cliw\u0105 odpowied\u017a, obejmuj\u0105c je znakiem pipes (| - pionowa kreska), przyk\u0142ad.: |pies|kot|ptak|\n<\/p>", 
