 "Checking this option, a \"Page X of Y.\" text will be added to every page of the exported content (except ePub's frontpage). This doesn't affect Single Page and Text File export files.": "Zaznaczaj\u0105c t\u0119 \u200b\u200bopcj\u0119, tekst \"Strona X z Y.\" zostanie dodany do ka\u017cdej strony wyeksportowanej tre\u015bci (z wyj\u0105tkiem strony tytu\u0142owej ePub). Nie ma to wp\u0142ywu na pliki eksportu pojedynczej strony i pliku tekstowego.", 
