 "%prog, the commandline version of eXe.\nUsage: %prog [options] input_file [output_file]\n\nTo show help:\n%prog -h": "%prog, wersja eXe z linii polece\u0144.\nU\u017cyj: %prog [opcje] input_file [output_file]\n\nAby wy\u015bwietli\u0107 pomoc:\n%prog -h", 
 "SCORM Options (1.2 and 2004)": "Opcje SCORM (1.2 i 2004)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text that are key to understanding the concepts. These will probably be verbs, nouns, and key adverbs. Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt> Je\u015bli Twoim celem jest sprawdzenie zrozumienia podstawowych poj\u0119\u0107 lub czytanie ze zrozumieniem  <\/dt>  <dd>    <p>  Napisz kr\u00f3tki opis koncepcji lub czytania wystarczaj\u0105co d\u0142ugie, aby odpowiednio sprawdzi\u0107 wiedz\u0119 docelow\u0105, ale wystarczaj\u0105co kr\u00f3tki, aby nie powodowa\u0107 zm\u0119czenia. Mniej ni\u017c jedna typowana strona jest prawdopodobnie wystarczaj\u0105ca, ale prawdopodobnie znacznie mniejsza powinna by\u0107 dla m\u0142odszych lub pocz\u0105tkuj\u0105cych uczni\u00f3w.    <\/p>    <p>Wybierz s\u0142owa w tek\u015bcie, kt\u00f3re s\u0105 kluczowe dla zrozumienia poj\u0119\u0107. B\u0119d\u0105 to prawdopodobnie czasowniki, rzeczowniki i kluczowe przys\u0142\u00f3wki. Wybierz alternatywy z jedn\u0105 jasn\u0105 odpowiedzi\u0105.    <\/p>  <\/dd>  <dt>Je\u015bli Twoim celem jest sprawdzenie znajomo\u015bci s\u0142ownictwa  <\/dt>  <dt>Je\u015bli Twoim celem jest sprawdzenie s\u0142owotw\u00f3rstwa\/gramatyki:  <\/dt>  <dd>  <p>Napisz tekst u\u017cywaj\u0105c odpowiednich form i zwrot\u00f3w. Tekst powinien by\u0107 konsekwentny i sp\u00f3jny oraz mie\u0107 stosown\u0105 d\u0142ugo\u015b\u0107. Pami\u0119taj, \u017ce celem nie jest sprawdzenie s\u0142ownictwa, wi\u0119c wi\u0119kszo\u015b\u0107 poj\u0119\u0107 powinna by\u0107 dobrze znana uczniom.  <\/p>  <p>Zaznacz kluczowe frazy w tek\u015bcie. Podaj  frazy zbudowane z podobnego zasobu s\u0142\u00f3w lecz o odmiennym znaczeniu. Dobrym pomys\u0142em jest poprosi\u0107 inn\u0105 osob\u0119 o przetestowanie testu\/\u0107wiczenia, aby unikn\u0105\u0107 niespodzianek!  <\/p>  <\/dd><\/dl>", 
