 "Change the styling:": "Zmie\u0144 styl:", 
 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p> Rozwijana Lista to teksty lub zdania, w kt\u00f3rych uczniowie musz\u0105 wybra\u0107 w\u0142a\u015bciwe s\u0142owa. S\u0105 one cz\u0119sto u\u017cywane do nast\u0119puj\u0105cych cel\u00f3w::<\/p><ol><li>Aby sprawdzi\u0107 wiedz\u0119 na temat podstawowych koncepcji kursu (mo\u017ce to by\u0107 kontrola wst\u0119pna, \u0107wiczenie formatywne lub sprawdzanie sumatywne).<\/li><li>Aby sprawdzi\u0107 zrozumienie czytania.<\/li><li>Aby sprawdzi\u0107 znajomo\u015b\u0107 s\u0142ownictwa.<\/li><li>Aby sprawdzi\u0107 s\u0142owotw\u00f3rstwo i\/lub kompetencje gramatyczne. <\/li><\/ol>", 
