 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>iObiekt Wikipedia pozwala zlokalizowa\u0107 \nistniej\u0105c\u0105 zawarto\u015b\u0107 z Wikipedii i pobra\u0107 t\u0119 zawarto\u015b\u0107 do zasobu eXe. \niObiekt wykonuje migawkow\u0105 kopi\u0119 tre\u015bci artyku\u0142u Wikipedii \nZmiany w Wikipedii nie b\u0119d\u0105 automatycznie aktualizowa\u0107 pojedynczych \nkopii migawek w eXe, konieczne b\u0119dzie pobranie nowej kopii artyku\u0142u. \nPodobnie zmiany dokonane w eXe nie b\u0119d\u0105 aktualizowane w Wikipedii. <\/p> <p>Tre\u015b\u0107 Wikipedii \njest obj\u0119ta licencj\u0105 GNU Free Documentation 1.2, a od 2009 r. dodatkowo \nlicencj\u0105 Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>", 
