 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Je\u015bli celem jest sprawdzenie umiej\u0119tno\u015bci czytania ze zrozumieniem <\/dt>  <dd>    <p> Napisz skr\u00f3cona wersj\u0119 tekstu, wystarczaj\u0105co d\u0142ug\u0105 do sprawdzenia wiedzy uczni\u00f3w, ale do\u015b\u0107 kr\u00f3tk\u0105 aby nie m\u0119czy\u0107. Mniej ni\u017c jedna strona maszynopisu  jest prawdopodobnie wystarczaj\u0105ca, ale dla m\u0142odszych uczni\u00f3w to mo\u017ce by\u0107 za du\u017co.  <\/p>    <p> Wybierz s\u0142owa kluczowe do zrozumienia tre\u015bci. Prawdopodobnie b\u0119d\u0105 one czasownikami lub  przys\u0142\u00f3wkami. Wybieraj mo\u017cliwo\u015bci z jedn\u0105 wyra\u017an\u0105 odpowiedzi\u0105.   <\/p>  <\/dd> <dt>Je\u017celi celem jest sprawdzenie zasobu s\u0142ow  <\/dt>  <dd>Napisz tekst u\u017cywaj\u0105c docelowego s\u0142ownictwa. Ten tekst powinien by\u0107 konsekwentny i sp\u00f3jny oraz mie\u0107 stosown\u0105 dlugo\u015b\u0107. Podkre\u015bl kluczowe s\u0142owa w tek\u015bcie. Wybieraj mozliwo\u015bci z jedn\u0105 wyra\u017an\u0105 odpowiedzi\u0105.  <\/dd>  <dt><dt>Je\u015bli celem jest sprawdzenie gramatyki oraz poprawno\u015bci budowania zda\u0144  <\/dt> <dd> <p> Napisz tekst u\u017cywaj\u0105c odpowiednich form i zwrot\u00f3w. Ten tekst powinien by\u0107 konsekwentny i sp\u00f3jny oraz mie\u0107 stosown\u0105 dlugo\u015b\u0107.   Pamietaj, \u017ce celem nie jest sprawdzenie s\u0142ownictwa, wi\u0119c wi\u0119kszo\u015b\u0107 poj\u0119\u0107 powinna by\u0107 dobrze znana uczniom.<\/p>  <p>Zaznacz kluczowe frazy w tek\u015bcie.   Wybieraj frazy zbudwane z podobego zasobu s\u0142\u00f3w lecz o odmiennym znaczeniu.  Dobrze jest sprawdzi\u0107 lekcje z inn\u0105 osob\u0105 aby unikn\u0105\u0107 niespodzianek.<\/p>", 
