 "Include Single Page export file?": "Do\u0142\u0105czy\u0107 plik eksportu pojedynczej strony?", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Nauczyciele u\u017cywaj\u0105c tego iObiektu powinni zwr\u00f3ci\u0107 uwag\u0119 na: <\/p><ol><li> Ilo\u015b\u0107 r\u00f3\u017cnych typ\u00f3w zada\u0144 planowanych w lekcji, kt\u00f3rych odpowiedzi zostan\u0105 uwidocznione. Unikaj u\u017cywania zbyt wielu r\u00f3\u017cnych typ\u00f3w zada\u0144 lub ich r\u00f3znego oceniania aby nie wprowadza\u0107 ucznia w b\u0142\u0105d. Zazwyczaj 3 lub 4 r\u00f3zne typy zada\u0144  s\u0105 wystarczaj\u0105ce do cel\u00f3w edukacyjnych.<\/li><li> Z perspektywy projektowania graficznego nale\u017cy unika\u0107 sytuacji kiedy dwa identyczne obiekty nast\u0119puj\u0105 po sobie bez rozdzielenia ich tekstem. Je\u015bli jest to niezb\u0119dne u\u017cy\u0107 do tego jednego obiektu.<\/li><li> U\u017cywaj takich zada\u0144, w kt\u00f3rych korzy\u015b\u0107 z rozwi\u0105zanaia  przewy\u017csza czas i wysi\u0142ek potrzebny do jego uko\u0144czenia.<\/li><\/ol>", 
