 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Je\u015bli pozostanie niezaznaczone, niewielka liczba b\u0142\u0119d\u00f3w pisowni i wielkich liter zostanie zaakceptowana. Je\u015bli zaznaczone, tylko dok\u0142adne dopasowanie w pisowni i wielkich literach b\u0119dzie akceptowane.<\/p><p><strong>Na przyk\u0142ad:<\/strong> Je\u015bli poprawn\u0105 odpowiedzi\u0105 jest <code>S\u0142o\u0144<\/code>, to zar\u00f3wno <code>s\u0142o\u0144<\/code>, jak i <code>S\u0142i\u0144<\/code> zostan\u0105 ocenione przez algorytm jako <em>\"wystarczaj\u0105co blisko\"<\/em>, poniewa\u017c ma tylko jedn\u0105 liter\u0119 niepoprawn\u0105, nawet je\u015bli \u201eSprawd\u017a wielko\u015b\u0107 liter\u201d jest w\u0142\u0105czone.<\/p><p>Je\u015bli sprawdzanie wielkich liter jest wy\u0142\u0105czone w powy\u017cszym przyk\u0142adzie, ma\u0142e litery <code>e<\/code> nie b\u0119d\u0105 uwa\u017cane za pomy\u0142k\u0119 <code>s\u0142i\u0144<\/code> r\u00f3wnie\u017c zostanie zaakceptowane.<\/p><p>Je\u015bli ustawione s\u0105 zar\u00f3wno \u201e\u015acis\u0142e oznaczanie\u201d, jak i \u201eSprawd\u017a wielkie litery\u201d, jedyn\u0105 poprawn\u0105 odpowiedzi\u0105 jest: \u201eS\u0142o\u0144\u201d. Je\u015bli zaznaczone jest tylko \u201e\u015acis\u0142e oznaczanie\u201d, a \u201eSprawd\u017a wielkie litery\u201d nie, \u201es\u0142o\u0144\u201d r\u00f3wnie\u017c zostanie zaakceptowany.<\/p>", 
