 "very easy": "bardzo \u0142atwe", 
 "\n        <h2>Click The Elements in Order Game<\/h2>\n        <p>\n                This builds a Javascript game where the player has to click on a certain place on the main area according to the hint.  \n                When they click correctly the positive feedback will come and the game will advance.  When they click the wrong\n                area negative feedback will be shown.  When they click on the correct area an item can be revealed there.  A delay\n                can be set to make the item disappear if desired after a delay.\n        <\/p>\n\n        ": "\n        <h2>Kliknij gr\u0119 Ustaw Elementy w Kolejno\u015bci<\/h2>\n        <p>\n                Gra utworzona w Javascript, w kt\u00f3rej gracz musi klikn\u0105\u0107 okre\u015blone miejsce na g\u0142\u00f3wnym obszarze zgodnie z podpowiedzi\u0105.  \n                Po prawid\u0142owym klikni\u0119ciu pojawi si\u0119 pozytywna informacja zwrotna i gra b\u0119dzie komtynuowana.  Po klikni\u0119ciu niew\u0142a\u015bciwego obszaru\n                zostanie wy\u015bwietlona negatywna opinia. Po klikni\u0119ciu na w\u0142a\u015bciwy obszar mo\u017cna odkry\u0107 przedmiot.  Mo\u017cna ustawi\u0107 op\u00f3\u017anienie,\n                 aby w razie potrzeby po pewnym czasie element znikn\u0105\u0142.\n        <\/p>\n\n        ", 
