 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Ten typ testu to \u0107wiczenie, w kt\u00f3rym z tekstu usuni\u0119to pewne wyrazy lub frazy. Ucze\u0144 musi wype\u0142ni\u0107 puste miejsca. Zazwyczaj u\u017cywany jest do nast\u0119puj\u0105cych cel\u00f3w:<\/p><ol><li>Do sprawdzenia wiedzy o podstawowych zagadnieniach lekcji (w formie sprawdzania przed, w trakcie i na zako\u0144czenie lekcji).<\/li><li>Do sprawdzenia zdolno\u015bci czytania ze zrozumieniem.<\/li><li>Do sprawdzenia zasobu s\u0142ownictwa (dla os\u00f3b ucz\u0105cych si\u0119 angielskiego).<\/li><li>Do sprawdzenia umiej\u0119tno\u015bci tworzenia zda\u0144 i\/lub gramatyki.<\/li><\/ol>", 
