 "Typically, Subject will be expressed as keywords, key phrases or classification codes that describe a topic of the resource. Recommended best practice is to select a value from a controlled vocabulary or formal classification scheme.": "Zazwyczaj Temat b\u0119dzie wyra\u017cony jako s\u0142owa kluczowe, kluczowe frazy lub kody klasyfikacji, kt\u00f3re opisuj\u0105 temat zasobu. Zalecan\u0105 najlepsz\u0105 praktyk\u0105 jest wyb\u00f3r warto\u015bci z kontrolowanego s\u0142ownictwa lub formalnego schematu klasyfikacji.", 
