 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>    What educational points are conveyed in the story<\/li>\n<li>    What preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>    Where the case study fits into the rest of the course<\/li>\n<li>    How the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Studium przypadku to obiekt, kt\u00f3ry zapewnia symulacj\u0119 uczniom maj\u0105cym podstawy edukacyjne. Wymaga to sytuacji, og\u00f3lnie opartej na rzeczywisto\u015bci, i prosi ucznia o zademonstrowanie lub opisanie, jakie dzia\u0142ania podejmie w celu uko\u0144czenia zadania lub rozwi\u0105zania sytuacji. Studium przypadku pozwala uczniom wykorzysta\u0107 swoj\u0105 w\u0142asn\u0105 wiedz\u0119 i do\u015bwiadczenie do wykonania powierzonych zada\u0144. Podczas projektowania studium przypadku nale\u017cy rozwa\u017cy\u0107 nast\u0119puj\u0105ce kwestie:<ul>\n<li>Jakie punkty edukacyjne s\u0105 przekazywane w opowiadaniu<\/li>\n<li>Jakie przygotowania b\u0119d\u0105 musieli wykona\u0107 uczniowie przed rozpocz\u0119ciem pracy nad studium przypadku<\/li>\n<li>Gdzie studium przypadku znajduje si\u0119 w dalszej cz\u0119\u015bci kursu<\/li>\n<li>W jaki spos\u00f3b uczniowie b\u0119d\u0105 wsp\u00f3\u0142dzia\u0142a\u0107 z materia\u0142ami i nawzajem, np. Je\u015bli pracujesz w klasie, mo\u017cesz przygotowa\u0107 zespo\u0142y do pracy nad r\u00f3\u017cnymi aspektami sprawy, a je\u015bli tak, to w jaki spos\u00f3b pomys\u0142y s\u0105 przesy\u0142ane z powrotem do klasy<\/li><\/ul>", 
