 "Teachers should keep the following in mind when using this iDevice: <ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "Podczas korzystania z tego iObiektu nauczyciel powinni zwr\u00f3ci\u0107 uwag\u0119 na: <ol><li> Ilo\u015b\u0107 r\u00f3\u017cnych typ\u00f3w aktywno\u015bci planowanych w lekcji jako widoczne wizualnie. Unikaj u\u017cywania zbyt wielu r\u00f3\u017cnych typ\u00f3w aktywno\u015bci lub ich klasyfikacji zaj\u0119\u0107, aby nie wprowadza\u0107 ucznia w b\u0142\u0105d. Zazwyczaj trzy lub cztery r\u00f3\u017cne typy s\u0105 wi\u0119cej ni\u017c wystarczaj\u0105ce dla zasob\u00f3w dydaktycznych.<\/li><li> Z perspektywy projektowania graficznego nale\u017cy unika\u0107 sytuacji kiedy dwa identyczne obiekty nast\u0119puj\u0105 po sobie bez rozdzielenia ich tekstem. Je\u015bli jest to niezb\u0119dne u\u017cyj do tego jednego obiektu.<\/li><li> U\u017cywaj takich p\u00f3l aktywno\u015bci, gdzie po\u017cytek wynikaj\u0105cy ze spostrze\u017ce\u0144 w trakcie rozwi\u0105zania zadania  przewy\u017csza czas i wysi\u0142ek potrzebny do uko\u0144czenia.<\/li><\/ol>", 
